import './App.css';
import './css/dashboard.css';
import { useState, useEffect } from 'react';
import { CSAPIInstance } from './classes/CounterStrikeApi';
import SearchBar from './components/search';
import OpenAIApiSingleton from './classes/OpenAIAPI';

function App() {

  const OPENAI_KEY = "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";
  //itemStats useStates
  const [itemName, setItemName] = useState<string>("");
  const [image, setImage] = useState<string>("");
  const [pricemed, setPriceMed] = useState<number>(0);
  const [exists, setExists] = useState<boolean>(false);
  const [searching, setSearching] = useState<boolean>(false);
  const [priceLatest, setPriceLatest] = useState<number>(0);
  const [pricelatestsell, setPriceLatestSell] = useState<number>(0);
  const [priceavg, setPriceAvg] = useState<number>(0);
  const [pricemin, setPriceMin] = useState<number>(0);
  const [pricemax, setPriceMax] = useState<number>(0);
  const [pricesafe7d, setPriceSafe7d] = useState<number>(0);
  const [pricesafe30d, setPriceSafe30d] = useState<number>(0);
  const [pricesafe90d, setPriceSafe90d] = useState<number>(0);
  const [offervolume, setOfferVolume] = useState<number>(0);
  const [sold24h, setSold24h] = useState<number>(0);
  const [sold7d, setSold7d] = useState<number>(0);
  const [sold30d, setSold30d] = useState<number>(0);
  const [sold90d, setSold90d] = useState<number>(0);

  const [infoText, setInfoText] = useState<string>("");
  //fetch itemHistory useStates
  const [avg, setAvg] = useState(0);
  const [median, setMedian] = useState(0);
  const [price, setPrice] = useState(0);
  const [sold, setSold] = useState(0);
  const [createdat, setCreatedAt] = useState("");

  const search = (name: string) => {
    let name_: string = "";
    let image_ = "";
    let pricemed_ = 0;
    let priceLatest_ = 0;
    let priceLatestSell_ = 0;
    let priceavg_ = 0;
    let pricemin_ = 0;
    let pricemax_ = 0;
    let pricesafe7d_ = 0;
    let pricesafe30d_ = 0;
    let pricesafe90d_ = 0;
    let offervolume_ = 0;
    let sold24h_ = 0;
    let sold7d_ = 0;
    let sold30d_ = 0;
    let sold90d_ = 0;

    //itemHistory temp vars
    let avg_ = 0;
    let median_ = 0;
    let price_ = 0;
    let sold_ = 0;
    let createdat_ = "";

    setSearching(true);

    CSAPIInstance.fetchItemStats(name)
      .then((val => {
        if (val != null) {

          image_ = val.image;
          pricemed_ = val.pricemedian;
          name_ = val.name;

          priceLatest_ = val.pricelatest;
          priceLatestSell_ = val.pricelatestsell;
          priceavg_ = val.priceavg;
          pricemin_ = val.pricemin;
          pricemax_ = val.pricemax;
          pricesafe7d_ = val.pricesafe7d;
          pricesafe30d_ = val.pricesafe30d;
          pricesafe90d_ = val.pricesafe90d;
          offervolume_ = val.offervolume;
          sold24h_ = val.sold24h;
          sold7d_ = val.sold7d;
          sold30d_ = val.sold30d;
          sold90d_ = val.sold90d;

          setItemName(name_);
          setImage(image_);
          setPriceMed(pricemed_);
          setPriceLatest(priceLatest_);
          setPriceLatestSell(priceLatestSell_);
          setPriceAvg(priceavg_);
          setPriceMin(pricemin_);
          setPriceMax(pricemax_);
          setPriceSafe7d(pricesafe7d_);
          setPriceSafe30d(pricesafe30d_);
          setPriceSafe90d(pricesafe90d_);
          setOfferVolume(offervolume_);
          setSold24h(sold24h_);
          setSold30d(sold30d_);
          setSold7d(sold7d_);
          setSold90d(sold90d_);
          setExists(true);

        } else {
          setExists(false);
        }
      })).catch((e) => {
        setExists(false);
        setSearching(false);
      })

    CSAPIInstance.fetchItemHistory(name)
      .then((val) => {
        if (val != null) {

          avg_ = val[0].avg;
          median_ = val[0].median;
          price_ = val[0].price;
          sold_ = val[0].sold;
          createdat_ = val[0].createdat;

          setAvg(avg_);
          setMedian(median_);
          setPrice(price_);
          setSold(sold_);
          setCreatedAt(createdat_);

        }
      })
  }


  return (
    <div className='App'>
      <SearchBar onPress={search} />
      {exists ?
        <>
        <div className = "row" >
          <div className='column'>
            <text className='header-text'>name: {itemName}</text>
            <div className="standard-box image-box">
              < img className="image" src={image} />
            </div>
          </div>
          <div className='column'>
            <text className='header-text'>median: ${pricemed}</text>
            <text className="header-text">info: {infoText}</text>
            <text className="header-text">latest listed price: ${priceLatest}</text>
            <text className="header-text">latest sold price: ${pricelatestsell}</text>
            <text className="header-text">average price: ${priceavg}</text>
            <text className="header-text">minimum price: ${pricemin}</text>
            <text className="header-text">maximum price: ${pricemax}</text>
            <text className="header-text">safe price (7d): ${pricesafe7d}</text>
            <text className="header-text">safe price (30d){pricesafe30d}</text>
            <text className="header-text">{pricesafe90d}</text>
            <text className="header-text">{offervolume}</text>
            <text className="header-text">{sold24h}</text>
            <text className="header-text">{sold7d}</text>
            <text className="header-text">{sold30d}</text>
            <text className="header-text">{sold90d}</text>
          </div>
        </div>

        </>
        : <>
          {searching ?
            <text className="header-text">Searching...</text>
            :
            <text className="header-text">Please Search A Valid Skin. Are You Sure The Wear Exists?</text>
          }
        </>
      }

    </div>
  );
}

export default App;
